(3, 'KAT01', '2020-12-03', 'Admin', 'HAL-HAL YANG HARUS ANDA KETAHUI SAAT KUCING ANDA AKAN MELAHIRKAN', 'Jika anda memiliki kucing yang hampir mendekati masa persalinan, sangat penting bagi anda untuk mempersiapkan kebutuhan sederhana si kucing. Hal itu tentunya dilakukan agar kucing anda tidak stress dan dapat melahirkan dengan nyaman. \r\n\r\nMelahirkan merupakan proses yang tidak pasti kapan terjadinya, apalagi pada kucing. Maka dari itu, terdapat beberapa poin penting untuk mengetahui perkiraan kapan kucing anda akan melahirkan dan bagaimana mempersiapkannya. Silahkan simak panduan sederhana dibawah ini.\r\n\r\n1.	Mempersiapkan rumah untuk persalinan kucing Anda\r\n\r\nIdealnya, kucing Anda yang hamil harus memiliki ruangan atau tempat untuk dirinya sendiri di periode akhir kehamilan. Ratu (kucing betina) dapat menjadi agresif dalam dua minggu terakhir periode kehamilannya, jadi pisahkan dan jauhkan dari anak-anak. Ruangan sebaiknya cukup hangat  sekitar 22C  untuk membantunya merasa nyaman dan mengurangi risiko hipotermia, dan idealnya dengan kelembapan sekitar 65-70%.\r\n\r\nAnda harus menyiapkan kotak sebagai sarang di mana ratu dapat melahirkan. Sarang ini dapat berupa kotak kardus yang cukup besar untuknya berbaring serta sisi yang cukup tinggi agar anak kucing tidak terjatuh. Alasi dengan plastik dan koran, agar dapat dibuang dengan mudah saat kotor, kemudian tutupi dengan selimut.\r\n\r\nKotak sarang harus lebih hangat dibanding keseluruhan bagian ruangan untuk mendukung anak kucing saat mereka sedang berada dalam keadaan paling rapuh selama beberapa hari pertama kehidupannya. Lampu inframerah merupakan cara yang bagus untuk melakukannya karena tidak memusatkan panas di satu area, dan sebaiknya diatur ke suhu 30C.\r\n\r\n2.	Cara mengetahui kapan kucing Anda akan melahirkan\r\n\r\nAnda mungkin tidak menyadari tahap awal persalinan kucing Anda karena tak ada kontraksi yang dapat dilihat. Namun, kucing akan tampak gelisah dan menunjukkan perilaku yang aneh seperti terus-menerus mengikuti  atau menghindari  Anda. Kucing juga akan menjadi sangat senang bersuara dan kerap merawat dirinya sendiri secara berlebihan.\r\n\r\nSaat kucing sudah siap untuk melahirkan, dia akan mencakar dan menempati kotak yang menjadi sarangnya, dan mulai mendengkur keras. Begitu Anda melihat keluarnya cairan kemerahan, tak lama kemudian anak kucing pertama dan plasentanya akan keluar  umumnya dalam waktu kurang dari satu jam.\r\n\r\nKucing dewasa berbaring di atas karpet putih dekat jendela dengan empat bayi kucing yang baru lahir.\r\nSelama proses melahirkan, kucing induk akan \'menangis\' dan terdengar stres, yang sepenuhnya wajar. Anda akan melihat anak kucing setiap 10 hingga 60 menit, dan kucing kemungkinan akan memakan plasenta dan mengunyah tali pusar anaknya. Jika dua jam telah berlalu sejak keluarnya cairan dan tidak ada tanda-tanda kelahiran, hubungi dokter hewan yang mungkin dibutuhkan untuk membantu kelahiran.\r\n\r\nKucing sangat pandai merawat diri selama persalinan, jadi cobalah untuk tidak mengganggu; cukup memeriksanya setiap 15 menit. Jika induk merasa stres, dia akan menunda persalinan dan mencegah kelahiran selama berjam-jam, atau bahkan berhari-hari.\r\n\r\n3.	Tanda anak kucing baru lahir yang sehat\r\n\r\nAnak kucing yang baru lahir akan segera merangkak menuju induknya dan mulai menyusu; sediakan susu kucing jika anak kucing Anda tidak melakukannya. Jika induk kucing tidak menjilati anaknya setelah memberi makan, Anda harus memijat anak kucing dengan kompres basah untuk membantu pencernaan dan ekskresi. Jaga agar ruangan tetap tenang dan hangat, dengan pintu tertutup  15-20% kucing yang merupakan ibu baru mengalami berahi dalam beberapa hari setelah melahirkan dan akan berkeliaran untuk menemukan pasangan, sehingga dapat membuat anak kucing rentan.\r\n\r\nKelahiran di rumah untuk kucing Anda yang hamil dapat membantunya merasa rileks dan bebas stres, sehingga memberi awal terbaik bagi anaknya. Jika tidak yakin apakah Anda telah menyiapkan rumah dengan cara yang benar, pastikan untuk meminta saran dari dokter hewan.\r\n', , 'https://www.royalcanin.com/id/cats/kitten/helping-your-pregnant-cat-give-birth-at-home');
