(4, 'KAT02', '2020-12-03', 'Admin', '15 CARA MERAWAT KAMBING AGAR CEPAT GEMUK DENGAN MUDAH', 'Bagi para peternak, memelihara hewan ternak dengan hasil yang memuaskan adalah kebanggaan tersendiri. Hal yang paling utama tentu saja harga jualnya menjadi lebih tinggi dan banyak yang berminat. Untuk Anda yang beternak kambing, akan lebih baik bila Anda tahu cara merawat kambing agar cepat gemuk. Bila kambing memiliki badan yang gemuk dan sehat dalam kurun waktu yang cepat, tentu saja Anda dapat segera menjualnya saat sudah sesuai dengan kebutuhan pasar.\r\n\r\nBerikut ini adalah beberapa tips dan cara merawat kambing agar cepat gemuk sehingga memperoleh banyak keuntungan.\r\n\r\n1. Menyesuaikan jumlah kambing dengan ukuran kandang\r\n\r\nCara merawat kambing agar cepat gemuk yang bisa Anda lakukan adalah dengan memperkirakan ukuran kandang yang tepat sesuai dengan jumlah kambingnya. Jangan sampai dalam kandang yang kecil terdapat banyak kambing sehingga ruang geraknya sangat terbatas. Ukuran idealnya Anda harus menyediakan 1,1 meter x 1,25 meter untuk setiap kambing. Jadi ukuran kandang tinggal Anda kalikan saja dengan kambing yang akan menghuninya.\r\n\r\n2. Memilih bibit yang unggul\r\n\r\nHal yang tak kalah penting untuk diingat adalah memilih bibit yang unggul. Biasanya potensi kambing akan mudah besar atau tidak dapat diketahui melalui beberapa ciri tertentu. Hal ini tentu saja berhubungan dengan faktor genetik dan bakatnya untuk tumbuh. Bila Anda masih pemula, Anda dapat meminta tolong pada yang sudah ahli untuk mencarikan kambing yang mudah gemuk perawakannya.\r\n\r\n3. Memilih lokasi yang tenang\r\n\r\nTernyata tumbuh kembang kambing juga dipengaruhi oleh lokasi tempat tinggalnya. Pilihlah kandang kambing yang lingkungannya tenang sehingga tidak terganggu oleh keramaian. Bila Anda meletakkannya di tempat yang tenang dan nyaman, nafsu makannya akan baik. Hindarkan dari keramaian karena akan membuatnya merasa stres, tidak mau makan dan sakit. Jika kambing sakit, pasti badannya akan lebih sulit menjadi gemuk.\r\n\r\n4. Memberikan pakan yang bernutrisi\r\n\r\nSyarat mutlak sebagai cara merawat kambing agar cepat gemuk adalah dengan memberi pakan yang bernutrisi. Pakan ini harus bervariasi dan berikan makanan yang disukai kambing agar nafsu makannya terjaga.\r\n\r\nRajinlah memberikan pakan hijau seperti dedaunan atau rumput yang dapat diperoleh dengan mudah di sekitar Anda. Dengan begitu pengeluaran Anda akan lebih sedikit namun tetap harus memberikan pakan yang kaya vitamin, karbohidrat, protein dan mineral agar sehat.\r\n\r\n5. Menjaga kebersihan kandang\r\n\r\nBersihkan kandang secara teratur dari kotoran dan juga pakan yang berjatuhan. Hal ini akan meminimalisir kambing dari penyakit yang bisa menyerangnya. Jangan sampai kambing Anda sakit dan berat badannya tak kunjung bertambah.\r\n\r\n6. Mengenali penyakit kambing\r\n\r\nWaspadalah dengan berbagai jenis penyakit yang bisa menyerang kambing kapan saja. Jadi bila ada tanda-tanda kambing sakit, segeralah cari tahu dan berikan obat sesuai dengan keadaannya dengan berkonsultasi pada tenaga kesehatan hewan.\r\n\r\n7. Memberi obat pada kambing yang sakit\r\n\r\nBila kambing Anda memang sakit, segeralah berikan obat sesuai dengan anjuran dokter hewan. Jangan sampai berlarut-larut dan bertambah parah.\r\n\r\n8. Mengendalikan penyakit pada kambing\r\n\r\nAnda harus tahu apakah penyakit yang diderita kambing mudah menular atau tidak kepada kambing lainnya. Bila menular, segera isolasikan dan pisahkan dari yang lain agar kambing lain tidak ikut sakit.\r\n\r\n9. Minum yang cukup\r\n\r\nSelain makanan, memberikan minuman juga harus dilakukan dalam jumlah yang cukup agar tubuhnya dapat sehat dan gemuk.\r\n\r\n10. Menjaga nafsu makan kambing\r\n\r\nAgar nafsu makan kambing baik dan cepat gemuk, Anda dapat menambahkan suplemen dan vitamin untuk kambing.\r\n\r\n11. Pakan fermentasi\r\n\r\nSelain pakan segar, Anda dapat memberi pakan fermentasi sebagai selingan. Pakan ini dapat terdiri dari dedak, garam, pakan hijau dan air. Ini akan sangat baik dan membuat kambing cepat gemuk.\r\n\r\n12. Memberi pakan tambahan\r\n\r\nAgar cepat gemuk berikan pakan tambahan pada kambing yang berupa bekatul, ampas tahu dan singkong.\r\n\r\n13. Kandang yang nyaman\r\n\r\nDengan memberi kandang yang nyaman, kambing akan tumbuh lebih sehat dan maksimal sehingga kualitas daging terjaga.\r\n\r\n14. Posisi kandang mendapat sinar matahari\r\n\r\nBuatlah kandang ditempat yang sejuk dan mendapat sinar matahari yang cukup. Akan lebih direkomendasikan untuk membuat kandang di dekat pohon rindang.\r\n\r\n15. Kandang cukup sirkulasi udaranya\r\n\r\nJangan biarkan kandang kambing Anda terlalu lembab dan pengap dengan memberi sirkulasi udara yang cukup. Hal ini tentu saja agar kandang kambing tidak bau.\r\n\r\nNah, ada banyak sekali tips dan cara merawat kambing agar cepat gemuk yang bisa dicoba. Lakukanlah satu persatu dan buktikan agar Anda dapat memperoleh kambing yang anda inginkan.\r\n', , 'https://starfarm.co.id/cara-merawat-kambing-agar-gemuk/');

